import React from "react";

class Header {
  render(props) {
    return (
      <div>
        <p> Welcome, {this.props.username}!</p>
      </div>
    );
  }
}
class Greeting {
  render() {
    const date = new Date();
    const hour = date.getHours();
    let timeOfDay = "";
    hour % 12 < 12
      ? (timeOfDay = "Morning")
      : hour % 12 > 17
      ? (timeOfDay = "Night")
      : (timeOfDay = "Noon");

    return <div></div>;
  }
}

export default class Map {
  render() {
    return (
      <div>
        <Header item={{ username: "jishnu" }} />
        <Greeting />
        <h1>hihihih</h1>
      </div>
    );
  }
}
